import React, { useState, useEffect } from "react";
import { Link } from "react-router-dom";
import { createPageUrl } from "../utils";
import { User, UserProgress } from "../entities/all";
import PressableButton from "../components/PressableButton";
import riceyLogo from "../assets/ricey-logo.svg";
import homeSvg from "../assets/home.svg";

export default function Home() {
  const [totalCooks, setTotalCooks] = useState(0);

  useEffect(() => {
    const fetchProgress = async () => {
      try {
        const user = await User.me();
        const progressRecords = await UserProgress.filter({ user_email: user.email });
        if (progressRecords.length > 0) {
          const progress = progressRecords[0];
          setTotalCooks(progress.completed_cooks || 0);
        }
      } catch (error) {
        console.log("User not logged in");
      }
    };
    fetchProgress();
  }, []);

  return (
    <div className="min-h-screen bg-[#fcfbf4] relative overflow-hidden font-pixel">
      {/* Background Pattern - Circles 48px */}
      <div className="absolute inset-0 opacity-10">
        <div className="w-full h-full" style={{
          backgroundImage: `url("data:image/png;base64,")`,
          backgroundSize: '48px 48px'
        }}></div>
      </div>

      {/* Top Logo - Frame 12 */}
      <div className="absolute top-8 right-8 z-10">
        <img src={riceyLogo} alt="Ricey Logo" className="w-7 h-11" />
      </div>

      {/* Main Content - Frame 2 */}
      <div className="relative z-20 flex flex-col items-center justify-center min-h-screen">
        <div className="w-[207px] flex flex-col items-center space-y-[63px]">
          {/* Header */}
          <header className="text-center w-[197px] h-[160px] flex flex-col justify-center">
            <div className="text-6xl font-bold text-black mb-2 leading-none">ricey</div>
            <div className="text-lg text-black font-normal">your rice guide</div>
          </header>

          {/* Main Logo - ricey-logo */}
          <div className="w-[153px] h-[243px] flex items-center justify-center">
            <img src={riceyLogo} alt="Ricey Logo" className="w-full h-full" />
          </div>

          {/* Main Action Button - Sharp Button */}
          <div className="w-[207px] h-[50.63px]">
            <Link to={createPageUrl("Cooking")}>
              <button className="w-full h-full bg-[#f30c59] text-white shadow-[-5.73px_5.73px_0px_#000000] hover:shadow-[-4px_4px_0px_#000000] hover:translate-x-[-1.73px] hover:translate-y-[1.73px] transition-all duration-150 font-code font-bold text-lg">
                Let's Cook!
              </button>
            </Link>
          </div>
        </div>
      </div>

      {/* Secondary Actions - Only show if user has cooked before */}
      {totalCooks > 0 && (
        <div className="absolute bottom-8 left-1/2 transform -translate-x-1/2 grid grid-cols-3 gap-4 w-full max-w-sm px-6">
          <Link to={createPageUrl("History")}>
            <button className="w-full bg-white hover:bg-gray-50 text-black py-3 px-4 rounded-lg shadow border border-gray-200 font-code font-medium text-sm">
              History
            </button>
          </Link>

          <Link to={createPageUrl("Achievements")}>
            <button className="w-full bg-white hover:bg-gray-50 text-black py-3 px-4 rounded-lg shadow border border-gray-200 font-code font-medium text-sm">
              Awards
            </button>
          </Link>

          <Link to={createPageUrl("Guide")}>
            <button className="w-full bg-white hover:bg-gray-50 text-black py-3 px-4 rounded-lg shadow border border-gray-200 font-code font-medium text-sm">
              Guide
            </button>
          </Link>
        </div>
      )}

      {/* Stats */}
      {totalCooks > 0 && (
        <div className="absolute bottom-20 left-1/2 transform -translate-x-1/2 text-center">
          <div className="text-sm text-black opacity-60 font-pixel">
            {totalCooks} successful cooks completed
          </div>
        </div>
      )}
    </div>
  );
}
